import React from 'react';
import './Styles.css';
const VideoLoop = () => {
  return (
    <div className="image-cover">
      <img className="image" src="https://images.unsplash.com/photo-1688728520752-45c031d358fb?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=387&q=80" alt="Cover Image" />
    </div>
  );
};

export default VideoLoop;
